const levels = [
    _support_constants__WEBPACK_IMPORTED_MODULE_1__.SECURITY_LEVELS.LOW,
    _support_constants__WEBPACK_IMPORTED_MODULE_1__.SECURITY_LEVELS.MODERATE,
    _support_constants__WEBPACK_IMPORTED_MODULE_1__.SECURITY_LEVELS.HIGH,
];
let previousCost = 0;
levels.forEach(level => {
    cy.get(_support_selectors__WEBPACK_IMPORTED_MODULE_0__.securityLevelWidget.availabilitySelect).select(level, { force: true });
    cy.wait(INTERACTION_DELAY);
    cy.get(_support_selectors__WEBPACK_IMPORTED_MODULE_0__.securityLevelWidget.integritySelect).select(level, { force: true });
    cy.wait(INTERACTION_DELAY);
    cy.get(_support_selectors__WEBPACK_IMPORTED_MODULE_0__.securityLevelWidget.confidentialitySelect).select(level, { force: true });
    cy.wait(500);
    cy.get(_support_selectors__WEBPACK_IMPORTED_MODULE_0__.costEstimationWidget.total).invoke('text').then(text => {
        // Extract numeric value (basic extraction)
        const costMatch = text.match(/[\d,]+/);
        if (costMatch) {
            const cost = parseInt(costMatch[0].replace(/,/g, ''), 10);
            cy.log(`${level} security cost: ${cost}`);
            if (previousCost > 0) {
                // Higher security should generally mean higher cost
                // Note: This is a general expectation, might need adjustment
                cy.log(`Comparing ${cost} with previous ${previousCost}`);
            }
            previousCost = cost;
        }
    });
});

